	findOverLapControl = function(divParentGroup){
		setShuffleEdit(true);
		divParentGroup.children[0].setFill('white');
		var blnCollide = false;
		for(prop=0,x=question_container_layer.children.length;prop<x;prop++){
			if(question_container_layer.children[prop].attrs.id!=divParentGroup.attrs.id){	
					var blnCollide = isRectCollide(divParentGroup,question_container_layer.children[prop])
					dragCollGroup = question_container_layer.children[prop];
					if (blnCollide)
					{
						break;
					}
			}
		}
		if(blnCollide){
			attempCount($('#shuffleNoAttempts'));
			console.log(divParentGroup.children[1].attrs.text + 'and' + question_container_layer.children[prop].children[1].attrs.text +'and result ' +blnCollide );
			console.log('draw x and y with collision' + dragControlX + 'and' + dragControlY);
			//implement the Answer Logic
			var ctrlid = question_container_layer.children[prop].attrs.id.split('drag')[1];
			isAnsCorrect = checkAnswer(divParentGroup.children[1].attrs.text,ctrlid);
			isSwapCtrlAnsCorrect = checkAnswer(dragCollGroup.children[1].attrs.text,divParentGroup.attrs.id.split('drag')[1]);
			console.log('collision occurs swap the groups' );
			/* this logic is for swap the text only*/
			var swapText = question_container_layer.children[prop].children[1].attrs.text;
			question_container_layer.children[prop].children[1].setText(divParentGroup.children[1].attrs.text);
			divParentGroup.children[1].setText(swapText);
			setKinectControlTopLeft(divParentGroup);
			divParentGroup.children[0].setWidth(divParentGroup.children[1].getWidth());
			divParentGroup.children[0].setHeight(divParentGroup.children[1].getHeight());
			question_container_layer.children[prop].children[0].setWidth(question_container_layer.children[prop].children[1].getWidth());
			question_container_layer.children[prop].children[0].setHeight(question_container_layer.children[prop].children[1].getHeight());
			shuffleAnsCounter++;
			var totalScore = parseInt(document.getElementById('shuffleQuestTotal').innerText.split("/")[1]);
			if(isAnsCorrect){
				count = parseInt(document.getElementById('shuffleResult').innerHTML);
				
				if(count<totalScore){
				document.getElementById('shuffleResult').innerHTML = count+1;}
				if(getPracticeMode()){
					question_container_layer.children[prop].children[0].setFill('white');
					question_container_layer.children[prop].children[0].setStroke('green');
					question_container_layer.children[prop].children[0].setStrokeWidth(2)
					question_container_layer.children[prop].children[1].setFill('green');
				}
			}
			setShuffleControl(divParentGroup.attrs.id,divParentGroup.children[1].attrs.text,isSwapCtrlAnsCorrect);
			if(isSwapCtrlAnsCorrect){
				count = parseInt(document.getElementById('shuffleResult').innerHTML);
				if(count<totalScore){
					document.getElementById('shuffleResult').innerHTML = count+1;
				}
				if(getPracticeMode()){
					divParentGroup.children[0].setFill('white');
					divParentGroup.children[0].setStroke('green');
					divParentGroup.children[0].setStrokeWidth(2)
					divParentGroup.children[1].setFill('green');
				}
			}
			setShuffleControl(question_container_layer.children[prop].attrs.id,question_container_layer.children[prop].children[1].attrs.text,isAnsCorrect)
			/* End of Swap text*/	
			checkShuffleCounterNeedsStop(shuffleAnsCounter);
			divParentGroup.draw();
			question_container_layer.draw();
		}else{
			console.log('draw x and y withot collision' + dragControlX + 'and' + dragControlY);
			setKinectControlTopLeft(divParentGroup);
			console.log('draw parent x and y withot collision' + divParentGroup.getX() + 'and' + divParentGroup.getY());
		}
		fixCanvasDrawBug(document.getElementById('container'));
	}
