	setKinectControlTopLeft = function(divParentGroup){
		for(var prop in collShuffleControls){
				if(divParentGroup.attrs.id == collShuffleControls[prop].id){
				divParentGroup.setX(collShuffleControls[prop].left);
				divParentGroup.setY(collShuffleControls[prop].top);
				break;
				}
			}
			divParentGroup.draw();
			question_container_layer.draw();
	}
	
	//this function works for groups only
	function isRectCollide(rec1, rec2)
	 {
	   var status = false;
	   var rec1Top = rec1.getY();
	   var rec1Bottom = rec1.getY() + rec1.children[0].attrs.height;
	   var rec1Left = rec1.getX();
	   var rec1Right = rec1.getX() + rec1.children[0].attrs.width;
	   var rec2Top = rec2.getY();
	   var rec2Bottom = rec2.getY() + rec2.children[0].attrs.height;
	   var rec2Left = rec2.getX();
	   var rec2Right = rec2.getX() + rec2.children[0].attrs.width;
	 if(!(rec1Bottom < rec2Top ||rec1Top > rec2Bottom ||rec1Left > rec2Right ||rec1Right < rec2Left))
	 	status = true;
	 return status;
	 }
	

