	input.style.width = width+controlSizeIn; //width+'px'; //(width)*100 +'%'; //'5%'
	//	input.style.minHeight= height+controlSizeIn; //height+'px';  //height+'%';
	if(input.id.split('clk').length>1){
		input.style.minHeight= height+controlSizeIn;
	}else{
		input.style.height= height+controlSizeIn; //height+'px';
	}
	return input;
